INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (276, 8659274, 6318433, 'Ambience: It\'s better at night. Friends who had been here during the day didn\'t like it much. So if you prefer ambience, go at night!', 4.9, '2007-10-19', '2007-10-19');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (297, 7958072, 6318213, 'The food was just average. Dishes were not prepared well, at least when compared to 4.1 rating on Zomato.', 3.9, '2007-11-02', '2007-11-02');
