INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (493, 13429576, 6601595, 'Good customer service, they know our drinks and food before we can order that\'s the amount of customisation this place offers.', 4.0, '2008-02-07', '2008-02-07');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (494, 7842050, 6600427, 'Taste is good but the best part is presentation,,, it\'s really meeting the standard of a 5 star restaurant .', 5.0, '2008-03-03', '2008-03-03');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (509, 8516023, 6310470, 'The staff were too slow in service and the food was refilles very slow.We had to wait for quite long time to actually eat to stomach full.', 3.3, '2008-06-08', '2008-06-08');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (543, 9618779, 6600214, 'Chairs and tables were broken food is cold and tasteless', 1.0, '2008-08-26', '2008-08-26');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (554, 7842050, 7304307, 'Overall a 5 star place, for dates, friend\'s gathering, reunions and a lot more.', 5.0, '2008-09-20', '2008-09-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (599, 11350336, 6600060, 'Service is very good and so i am happy', 4.8, '2008-09-21', '2008-09-21');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (603, 14916476, 6600214, 'Overall one will enjoy the ambiance and food. Better to have a reservation during weekends.', 4.7, '2008-10-31', '2008-10-31');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (605, 14323797, 6600427, 'Better ambience at night... And importantly good quantity!', 4.6, '2008-11-22', '2008-11-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (635, 14323797, 18185059, 'The food had great flavours, brilliantly cooked juicy prawns and the coconut sambol like side just tingle your taste buds. The southern fish fry and masala fried prawns are a delight! Great lighting and courteous staff.', 4.7, '2008-11-26', '2008-11-26');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (641, 11024162, 6315438, 'Ambience was good too with live music. Food was served timely. Decor of the restaurant was amazing as well.', 4.5, '2008-11-28', '2008-11-28');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (642, 61134526, 6601361, 'I cannot stress enough on how I have loved all that I tried here. I have also tried out their lunch buffet. The variety may not be as elaborate as other places, but with the food quality and the discount that they offer for bulk bookings, it is at least a one-time try. But what I really adore here is their mocktails. Beyond Delight is an absolute delight! Also a fan of the Guava and Chilli, and Apple and Kiwi Night drinks.', 5.0, '2008-12-11', '2008-12-11');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (645, 6446070, 6600060, 'The taste was ok and not to expect too much. Little disappointing when starters are not hot.', 3.6, '2008-12-24', '2008-12-24');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (661, 8151369, 18182702, 'Big surprise for me is Onion rings as starters', 4.0, '2009-01-19', '2009-01-19');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (717, 29946427, 6304287, 'For the money we pay, we expect some good food. They use much of colour in food item\'s.', 3.0, '2009-01-25', '2009-01-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (727, 61134526, 6601361, 'Suggestion to management is use less coating and less food colouring in starters.', 3.4, '2009-02-25', '2009-02-25');
