INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (894, 7958072, 6601218, 'Place was good for starters and mocktails.', 4.4, '2011-03-26', '2019-08-21');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (909, 29946427, 6309903, 'Not good', 1.2, '2011-04-04', '2015-09-24');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (916, 8516339, 6304287, 'Everything was superb.', 1.5, '2011-04-13', '2018-09-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (922, 6866610, 6301290, 'This is one of the finest in New York City! Perfect to gather with family and loved ones. Excellent food and excellent attentions. Its become my favorite!!! Loved everything!', 5.0, '2011-04-28', '2014-11-11');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (929, 11350336, 6601158, 'Good pasta. Good Price. Good service. Highly recommended to eat an Italian food in NYC. Obviously, the place is a fast food restaurant but honest and healthy.', 4.6, '2011-11-21', '2013-11-03');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (973, 7251577, 6600379, 'Amazing food, service impeccable.  Beautiful Art Neouv  setting.  Tables properly distanced from one to another.  Well to see that it was filled with people of all ages: Young, middle aged and elderly.  Very low noise level, and we could actually have a conversation.', 4.1, '2011-12-31', '2017-11-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (976, 7251577, 18185059, 'The food was absolutely amazing and the service was incredible. Linda was our server, and was incredibly sweet and helpful with getting us our food and was very welcoming in general. The tomato caprese was the best I have ever had.', 5.0, '2012-01-04', '2013-07-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1005, 7902269, 6601602, 'Hmm ok ?', 3.3, '2012-01-30', '2013-11-06');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1028, 14763733, 18189371, 'It has to be in our list definitely', 5.0, '2012-02-04', '2017-02-07');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1033, 8630833, 6600379, 'The service is good and the staff is courteous too.', 4.3, '2012-02-05', '2015-03-30');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1035, 9618779, 6600379, 'There are some exotic food that is a must try thing at flechazo like prawn orange shots', 4.8, '2012-04-10', '2018-11-27');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1050, 10170794, 7303219, 'Love coming to this place again and again and again !', 5.0, '2012-05-01', '2017-05-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1054, 55898624, 6300010, 'Would like to visit again.', 4.5, '2012-05-14', '2013-01-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1060, 11024162, 6318506, 'Love the place', 5.0, '2012-06-11', '2018-04-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1061, 6624899, 6304287, 'Service is excellent', 4.7, '2012-06-17', '2019-02-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1100, 8807695, 6601595, 'Me and some friends visited here for dinner and we were served by Suzanna. The food was amazing and we all enjoyed ourselves. We would all definitely be visiting again!', 4.9, '2012-07-02', '2018-10-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1126, 11024162, 6314302, 'The quality sets it apart from its competition. It is guaranteed that you will get the same excellent quality of food everytime', 5.0, '2012-07-27', '2013-08-05');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1131, 6878245, 6300781, 'I suggest everyone not to order any food from this restaurant', 0.0, '2012-08-02', '2015-11-06');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1149, 8516023, 6318213, 'The food was good i had a salami and mozarella with basalmic vinegar on a long roll. The only vet i have is I would have preferred they use gloves. But they are old school.', 3.1, '2012-08-28', '2017-11-17');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1209, 13429576, 6310470, 'Definitely don\'t go here if you have allergies. Not only do they have cross contamination but then the manager argued with us as my friends throat was closing denying it was the restaurant and blaming it on her! Talk about adding insult to injury! RUDE!', 0.0, '2013-01-14', '2014-04-27');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1212, 11372603, 6318213, 'Meal was amazing - over generous portions with an innovative selection of cocktails to select from. Outdoor dining was well spaced out and indoor dining had partitions as well. Service was very fast - special shout out to our amazing server Michele! Will be coming again', 5.0, '2013-01-19', '2018-06-24');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1281, 6624899, 6601218, 'Been here a bunch of times and it\'s a nice addition to the neighborhood. They don\'t serve liquor which makes it an interesting place but the taps and beer selection are very good.', 4.8, '2013-02-09', '2019-01-13');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1308, 6916349, 7300515, 'Food is great but I don\'t understand why they can accept only 4 credit cards per table. Me and my 11 group of friends needed to start looking for an atm to pay for the food at 11 pm.', 0.2, '2013-08-07', '2017-01-13');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1364, 7902269, 6601515, 'As authentic as it gets! The space is tiny and crowded, but if you can handle that-get ready for some amazing home-made pasta! Definitely will return.', 3.7, '2013-10-22', '2014-07-08');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1439, 11024162, 7300955, 'Superb little find. My partner and I went for valentines night. Arancini to start and beef carpaccio. Absolutely superb.', 4.2, '2013-10-31', '2019-03-27');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1469, 10170794, 18185059, 'For mains wild boar ravioli and my partner had shrimp pasta. Cooked to perfection. The staff are attentive. Do not be put off how small this...', 4.6, '2013-12-31', '2016-03-01');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1478, 14916476, 6600060, 'What a find! Stumbled across this place on our travels to another restaurant. Decided to stop in and ended up returning twice. The food is beautiful, especially the pasta and lasagne! All so fresh, made to order and quick service!', 4.8, '2014-04-19', '2016-09-07');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1498, 6940030, 6600379, 'We visited this restaurant a few days after having a fantastic experience at their east 53rd st restaurant, and unfortunately it was a very different experience.', 3.2, '2014-06-03', '2017-10-30');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1502, 16782433, 6600214, 'My wife and I wanted to give this place  a try based on TA reviews and the desire for some homemade pasta. The place is small which was okay; however, the table was real small and it seemed like everything was being squeezed to make more space', 2.5, '2014-08-22', '2017-10-19');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1574, 55898624, 6310470, 'I don\'t know where all these reviews are coming from, but got some take out tonight, and it is easily the worse thai food I have ever had!', 1.1, '2014-08-23', '2018-12-10');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1630, 14763733, 6304287, 'Very good. Small little place, maybe 34 seats or so in the restaurant. Food was great. Very nice friendly service. We came early for our reservation and they seated us. We would come again!', 4.9, '2014-10-04', '2018-07-09');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1674, 11024162, 6310406, 'I\'m a usual customer here due to good food at reasonable prices. However, we are puzzled and dismayed by the way we were treated this evening!!', 0.6, '2014-11-14', '2018-08-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1690, 12163978, 6601862, 'We were very exciting to try this restaurant. The ambiance is beautiful and the service is phenomenal. However, I found the food to be just average. We got the 7 course tasting, and we didn\'t care for most of the dishes.', 2.7, '2014-11-20', '2018-12-30');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1721, 13429576, 6601005, 'We waited nearly an hour between starter and main. When main arrived, fillet steak was overly charred and dry. Asked for a peppercorn sauce to relieve the challenge of swallowing dry meat, but unfortunately took 10 minutes to arrive. Steak fries A bit over-done.', 2.6, '2015-01-06', '2017-06-07');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1730, 9618779, 6600427, 'The food and drinks were great! Definitely recommend! Our food came really quick & we were pleased! They were friendly and made it a great experience overall', 4.5, '2015-02-06', '2016-09-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1891, 7902269, 18189371, 'This is a really fancy place and probably fancier than you would expect just looking from the outside.', 4.0, '2015-03-29', '2019-03-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (1953, 61134526, 7301215, 'Nice fresh ingredients, authentically cooked - the service was as good as was the draught beer', 4.3, '2015-04-19', '2017-05-16');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2074, 45652154, 6601218, 'Based on Tripadvisor, went to look for this place. Even though I was specifically looking for this, I walked straight passed it, as it is in a basement, somewhat different from what I expected and not immediately visible from the street.', 4.6, '2015-04-21', '2016-06-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2087, 8516023, 6601457, 'The cozy ambience, large size of the steaks, and wonderful service would have made for a great evening. Sadly, my ribeye had poor texture, was very dry, not very tender.', 2.5, '2015-06-09', '2019-04-17');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2103, 6866610, 6300002, 'Went because of the great reviews but we must have hit a bad night. The good news....beautiful atmosphere, nice staff. NYC restaurants being shut down the day after our dinner may have been a factor, but it is no excuse.', 2.1, '2015-06-20', '2017-05-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2170, 6473133, 7301215, 'Had a filet mignon with a California red. The term was excellent. Service was great and very attention to detail.', 5.0, '2015-07-21', '2018-11-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2194, 61134526, 6601602, 'I\'ve been to this restaurant twice now and both times was served tasty food. Something I wouldn\'t recommend would be the lamb rogan gosh. It was dry and the sauce wasn\'t nice at all. I do recommend the chicken lollipops and the General Toast chicken...', 3.5, '2015-10-08', '2019-03-17');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2268, 14793356, 6600441, 'I found Spice Symphony by researching restaurants on Trip Advisor and it was a great find! Everything we had here was delicious. The portions are just right and everything was seasoned well without being overdone. I would definitely return on my next visit to New York.', 4.6, '2015-11-13', '2018-01-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2392, 7958072, 6318506, 'You can smell the delicious beef broth before you see the sign for Mei jin ramen. The spicy beef ramen is incredibly savory and really worth a try. The atmosphere is friendly and the wait staff is very sweet and attentive.', 4.4, '2016-02-12', '2017-07-21');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2457, 10026181, 6601218, 'Place is very nice and efficient service! There are an extensive sake menu that you can buy by the glass or by the bottle.', 4.1, '2016-02-13', '2016-09-09');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2547, 6916349, 6318433, 'Have always wanted to try Daniel after friends raved about it. Personally, I found the entire experience distinctly average.', 1.9, '2016-02-17', '2016-12-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2581, 9757245, 7303219, 'Came here on a Tuesday night and it was busy, but they sat us! The food was incredible and very well priced for the location. Loved the service too! Belle was lovely.', 3.8, '2016-03-19', '2017-02-27');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2716, 8516023, 7304307, 'Drinks were amazing. Definitely recommend coming to this spot. They were friendly and made sure i was happy.', 4.5, '2016-04-22', '2018-04-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2804, 7902269, 7304307, 'Great service, delicious pizza and lovely neighborhood feel. Vegan cheese available and a terrific wine list.', 4.6, '2016-06-04', '2017-10-31');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2934, 12091132, 6314302, 'We enjoyed eating out on their back patio on a warm fall afternoon. It was a quiet break from the business out in the city. The pizza was very good and we enjoyed being able to select from several Italian beers.', 4.7, '2016-06-23', '2018-04-21');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2955, 14323797, 6601361, 'The overall experience was great. The food excellent and the service outstanding. Yes you pay the price! it\'s not cheap. But the experience is well worth it. Sommelier was spot on with his suggestions.  We had a great time.', 4.9, '2016-07-01', '2016-11-04');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2960, 6624899, 6315438, 'From the streetscape facade to the welcoming glow on the staff\'s face, one knows that you are in for a lavish experience. This was a Christmas gift for myself.....and Santa must have thought I was very good boy this year! Each course was divine.', 5.0, '2016-07-03', '2017-12-06');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (2987, 8659274, 18189371, 'Real nice, tasty, well baked pizza. Nice setting and friendly staff. If we ever visit New York again we sure will come back!', 4.8, '2016-08-07', '2019-05-01');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3089, 12047080, 6318213, 'Absolutely great restaurant which is unique thanks to the chefs. we will be happy to come back again.  Thanks to the whole team', 4.5, '2016-09-12', '2019-08-31');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3196, 8017245, 6600292, 'This was a great NYC Italian restaurant experience! Check to see if you need reservations, we did even on a Monday evening for an early seating of 4 (early being 6:30 pm).', 5.0, '2016-12-28', '2017-07-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3223, 10170794, 18182702, 'This had to be one of the best meals I ha eve we had. Every meal we had was excellent. The place in tiny but worth a visit.', 4.6, '2017-02-10', '2017-06-26');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3338, 6446070, 6318506, 'We fell in love with this pasta. It was gorgeous! Place is very cozy and staff is also very friendly.', 5.0, '2017-03-11', '2017-07-31');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3377, 9757245, 6314605, 'This restaurant was an excellent find! Very cozy atmosphere. The wine and dishes were both outstanding. Our only regret is not finding this place sooner!', 4.6, '2017-03-22', '2018-07-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3670, 11372603, 6601158, 'Our first time in Soho! Excellent Restaurant. Great Italian White wine selection. We had an octopus salad and a seafood pasta. Very good service and food.', 4.7, '2017-05-04', '2017-09-30');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3706, 6916349, 6600379, 'Who thought meatballs or spicy sausages could be plant based. Not only there is passion in creating outstanding diahes, the enthusiasm of the staff is infectious. Try the red lentil penne and beyond sausage, italian hot sausage made with onion, red cabbage and red wine.', 5.0, '2017-07-09', '2018-09-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3715, 7055991, 6600441, 'This is out favorite indochinese restaurant in the city. Highly recommend their chicken lollipop. Service is always great. Nasir is the best! Highly recommend it', 4.4, '2017-08-06', '2018-02-23');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3716, 14763733, 18182702, 'Visited an a rainy Feb day for the fixed price lunch. Several good choices of appetizers, entrees and dessert. Well presented and prepared dishes with complimentary cucumber yogurt salad.', 4.9, '2017-08-11', '2017-12-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3786, 8516339, 6600060, 'Tried it the first time and will be coming back.  Tried their pizza and it was amazing, a must for workers or visitors in the area.  Staff was very helpful and very nice.  A must , can not wait to try something else.', 5.0, '2018-02-02', '2019-07-04');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3790, 10026181, 6310406, 'Nicely located near the Rockefeller, this is great for wheelchair access and service. Pasta was great,  pizza unavailable, but chicken salad was returned.', 3.7, '2018-08-19', '2019-05-23');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (3822, 11372603, 18185059, 'This is a very good place for breakfast or lunch. You can have a coffee at a decent price or have a lovely Italian lunch at a good price too. We have been there several times and if we go back to New York we will come here again.', 4.6, '2018-09-29', '2019-01-11');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (4007, 11471765, 6314302, 'Nice salads and pastas. Quick service lunch time even though it looks crazy busy.', 4.2, '2018-11-28', '2019-04-04');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (4131, 45652154, 6600441, 'Hubby and I are eager to dine outside in NYC, but so many restaurants are not complying with the 6 foot distance between tables. We were very pleased to see that Spice Symphony on 50th St. had good spacing, so we decided to try it.', 4.4, '2019-01-14', '2019-05-28');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (4153, 7089849, 18182702, 'Worth a stop in for lunch.', 3.8, '2019-04-28', '2019-06-02');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (4157, 8516023, 6308205, 'What a gem! Roxana was an amazing waitress. The food was amazing and the atmosphere was so happy. Would definitely go back!', 4.6, '2019-08-09', '2019-08-19');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (4170, 11350336, 6318506, 'The service is mediocre at best.  We waited 45 minutes for a salad appetizer . It looked pathetic , dry, and totally uninspiring . The best part was that I did not get my cutlery for another 15 minutes.', 1.0, '2019-09-23', '2019-10-12');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (5673, 45652154, 6304287, 'Popped in for a Prix Fixe lunch which is pretty good value at 3 courses for $40. Service from the host was great; though very frantic and a quite rushed from other staff.', 4.5, '2020-01-29', '2020-01-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (6192, 8151369, 6601158, 'Amazing drinks and even better food. i got one of the juiciest and flavorful filet mignons i\'ve ever had! definitely recommend!', 4.7, '2020-02-18', '2020-02-18');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (7472, 14793356, 6601602, 'Steaks were very good; sides were fine.', 3.5, '2020-02-15', '2020-02-15');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (8624, 7251577, 18182702, 'We are into a bit different style of pizza. So for us was good but no special. Our guess is from Sardinia and she loved it.', 4.5, '2020-03-10', '2020-03-10');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9274, 7902269, 18189371, 'Love the ramen here. Come here for the draft beers. My go to place for friends and ramen. Shishito peppers good here too', 4.2, '2020-04-20', '2020-04-20');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9275, 10026181, 6314302, 'My friend recommended meeting here for dinner after work. They have a good happy hour special with a lot of drinks to choose from. Also delicious food:)', 4.5, '2020-04-21', '2020-04-21');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9276, 6446070, 6601218, 'Versatile menu, many more options than most ramen places. The staff is also very friendly and accommodating!', 4.3, '2020-04-22', '2020-04-22');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9277, 11372603, 6601218, 'From the amazing pork buns to the many ramen options, you can\'t go wrong! Everything on the menu is beyond delicious!', 4.3, '2020-04-23', '2020-04-23');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9278, 61134526, 7304307, 'Exquisite chef\'s tasting menu. Well suited for both a business dinner our romantic night out. The wine/liquor pairing is a must. Expensive but worth it.', 4.0, '2020-04-24', '2020-04-24');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9279, 14763733, 6300010, 'We had a fantastique dinner here yesterday. The atmosphere is relaxed but still proffessional and the service is personal and you feel at home early. Great wine list but comparing to europe it was a bit expensive on french wines so we had some nice Italian wine', 3.4, '2020-04-25', '2020-04-25');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9280, 14916476, 6601361, 'I think this is best Korean restaurant in New York! Asian food ( mostly Korean) mix European serving, so amazing! I will definitely be there again when I am in New York next time.', 5.0, '2020-04-26', '2020-04-26');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9281, 7251577, 6304287, 'We very much enjoy Indian Food and are always looking for a restaurant to try. We stopped for lunch only to discover this Spice Symphony was not the same Spice Symphony we had eaten at before.  We were delighted we know we had another option.', 4.5, '2020-04-27', '2020-04-27');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9282, 6624899, 6301290, 'This is our favorite restaurant when it comes to Indian food. I take all my friends and relatives here. Excellent food and service.', 4.2, '2020-04-28', '2020-04-28');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9283, 8807695, 6601158, 'Great experience; from the outside this restaurant does not look particularly appealing; however, the food was great and very nice and good service. We were a group of four and the restaurant prepared various dishes to try. Also good drinks and good value for money.', 4.4, '2020-04-29', '2020-04-29');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9284, 11024162, 6600379, 'This is where I bring all my out of town friends to eat in my Murray Hill neighborhood. Excellent food and service. Friendly staff. Reasonably priced. Good lunch special for about $13/person. Convenient location. Spice Symphony at E.31st Street is in Curry Hill.', 4.7, '2020-04-30', '2020-04-30');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9285, 6878245, 6318506, 'Really enjoyed dining al fresco in the patio. Food was succulent. The crab cake and the guacamole were to die for and my New York Sirloin Steak was perfectly cooked. I topped it off with a \"tres leches\".', 4.6, '2020-05-01', '2020-05-01');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9286, 8516023, 6318433, 'Extremly nice restaurant with great service and the athmosphere was great. We were 9 persons with a prebooking and all enjoyed this dinner. Really recommend this restaurant and make sure to book as this seems to be a very popular place to dine at.', 5.0, '2020-05-02', '2020-05-02');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9287, 8284823, 6318213, 'Had a tasty steak with a glass of wine. The meat was really good and I warmly recommend this restaurant.', 4.3, '2020-05-03', '2020-05-03');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9288, 7089849, 6318506, 'Loved the atmosphere, our waitress was super friendly, and the food was to die for. Their signature cocktails introduced very unique flavor combinations to my palette but I must say I was very pleasantly surprised!', 4.9, '2020-05-04', '2020-05-04');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9289, 10170794, 6314605, 'Food was great and so was the service!! Food came really quick and the quality was good! Would come back again', 4.5, '2020-05-05', '2020-05-05');
INSERT INTO `restaurants`.`review` (`id`, `customer_id`, `restaurant_id`, `content`, `rating`, `date_created`, `date_modified`) VALUES (9290, 24517684, 6601158, 'Visiting NYC for the week and wanted to get some Asian food for dinner with friends. We had a vegan buddy with us, and Obao had something for everyone! The pad thai was AMAZING!! Highly recommend.', 4.0, '2020-05-06', '2020-05-06');
